//火箭
export const USERPLAY_PLAY_PLAYGAME_ROCKET = '/v1/userPlay/playGame?gameId=3';
export interface PlayGameRocketReq {
  targetRate: number;
  betAmount: number;
  currencyId: number;
}
export interface PlayGameRocketResp {
  result: number;
  betAmount: number;
  isWin: number;
  balance: number;
}

//当前游戏记录
export const GET_GAME_RECORD = '/v1/userPlay/getGameRecord';

export interface GetGameRecordReq {
  gameId?: number;
  limit?: string;
}
export interface GetGameRecordResp {
  id: number;
  name: string;
  createTime: string;
  chip: number;
  rate: number;
  win: number;
  currencyIcon: string;
  currencyId: number;
  gameIcon: string;
}

/**登录第三方游戏 */
export const LOGINGAME = '/v1/third/loginGame';
export interface LoginGameReq {
  gameId: string;
}
export const FALSEPG = '/v1/falsePg/getGameUrl';
export interface FalseGameReq {
  gameId: string;
  language: string;
}
